import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import { Calendar, ShoppingCart, ChefHat, Home, User } from 'lucide-react';
import MealPlanner from './components/MealPlanner';
import GroceryInventory from './components/GroceryInventory';
import SmartPlanner from './components/SmartPlanner';
import UserPreferences from './components/UserPreferences';
import MealPrepScheduler from './components/MealPrepScheduler';
import './App.css';

function App() {
  const [groceries, setGroceries] = useState([]);
  const [mealPlan, setMealPlan] = useState({});
  const [preferences, setPreferences] = useState({
    allergies: [],
    likes: [],
    dislikes: [],
    dietaryTypes: []
  });

  return (
    <Router>
      <div className="app">
        <nav className="navbar">
          <div className="container">
            <div className="nav-brand">
              <ChefHat size={24} />
              <span>Meal Planner</span>
            </div>
            <div className="nav-links">
              <Link to="/" className="nav-link">
                <Home size={20} />
                Home
              </Link>
              <Link to="/planner" className="nav-link">
                <Calendar size={20} />
                Plan Meals
              </Link>
              <Link to="/inventory" className="nav-link">
                <ShoppingCart size={20} />
                My Groceries
              </Link>
              <Link to="/preferences" className="nav-link">
                <User size={20} />
                Preferences
              </Link>
            </div>
          </div>
        </nav>

        <main className="main-content">
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route 
              path="/planner" 
              element={
                <MealPlanner 
                  mealPlan={mealPlan} 
                  setMealPlan={setMealPlan}
                  preferences={preferences}
                />
              } 
            />
            <Route 
              path="/inventory" 
              element={
                <GroceryInventory 
                  groceries={groceries} 
                  setGroceries={setGroceries} 
                />
              } 
            />
            <Route 
              path="/smart-planner" 
              element={
                <SmartPlanner 
                  groceries={groceries} 
                  setMealPlan={setMealPlan}
                  preferences={preferences}
                />
              } 
            />
            <Route 
              path="/preferences" 
              element={
                <UserPreferences 
                  preferences={preferences} 
                  setPreferences={setPreferences} 
                />
              } 
            />
            <Route 
              path="/meal-prep" 
              element={
                <MealPrepScheduler 
                  mealPlan={mealPlan} 
                />
              } 
            />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

function HomePage() {
  return (
    <div className="container">
      <div className="hero">
        <h1>Smart Meal Planning Made Easy</h1>
        <p>Plan your weekly meals and generate grocery lists, or use what you have at home to create delicious meal plans.</p>

        <div className="feature-cards">
          <Link to="/planner" className="feature-card">
            <Calendar size={32} />
            <h3>Plan Weekly Meals</h3>
            <p>Create meal plans for breakfast, lunch, dinner, and snacks. Get automatic grocery lists.</p>
          </Link>

          <Link to="/inventory" className="feature-card">
            <ShoppingCart size={32} />
            <h3>Manage Groceries</h3>
            <p>Track what you have at home and get smart meal suggestions based on your inventory.</p>
          </Link>
        </div>
      </div>
    </div>
  );
}

export default App;
